import React from 'react';
import './App.css';
import Main1 from './Components/main';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component{
  constructor(){
    super()
    this.state={
      value2:'',
      value3:"LTC",
      value4:"BTC",
      value5:'ltc',
      value6:"btc",
      value10:'lite',
      value11:'bit',
      from:'ltc',
      to:'btc',
      show:'none',
    }
  }

  changevalue = ()=>{
    this.setState({
      value2:'receive',

    })
  }

  reverse1= ()=>{
    this.setState({
      value3:this.state.value4,
      value4:this.state.value3,
      value5:this.state.value6,
      value6:this.state.value5,
      value10:this.state.value11,
      value11:this.state.value10
    })
  }

  changetodoge1 = ()=>{
    this.setState({
      value3:'DOGE',
      value5:'doge',
      value10:'doge',
      from:'doge',
    })
  }


  changetodoge2 = (event2)=>{
    this.setState({
      value4:'DOGE',
      value6:'doge',
      value11:'doge',
      to:'doge',
      from:''
    })
    const value100=event2.target.value
    if (value100[0]!='D') {
      this.setState({
        show:'block'
      })
    }
    if (value100[0]=='D') {
      this.setState({
        show:'none'
      })
    }
    if (value100[0]==null) {
      this.setState({
        show:'none'
      })
    }

  }


  changetoltc1 = ()=>{
    this.setState({
      value3:'LTC',
      value5:'ltc',
      value10:'lite',
      from:'ltc1',
    })
  }

  changetoltc2 = (event2)=>{
    this.setState({
      value4:'LTC',
      value6:'ltc',
      value11:'lite',
      to:'ltc',
      from:''
    })

    const value100=event2.target.value
    if (value100[0]!='L' && value100[0]!='M') {
      this.setState({
        show:'block'
      })
    }
    if (value100[0]=='L' || value100[0]=='M' || value100[0]=='l' || value100[0]=='l'  ) {
      this.setState({
        show:'none'
      })
    }
    if (value100[0]==null) {
      this.setState({
        show:'none'
      })
    }

  }

  changetobtc1 = ()=>{
    this.setState({
      value3:'BTC',
      value5:'btc',
      value10:'bit',
      from:'btc',
    })
  }

  changetobtc2 = ()=>{
    this.setState({
      value4:'BTC',
      value6:'btc',
      value11:'bit',
      to:'btc',
      from:''
    })

    const value100=event2.target.value
    if (value100[0]!='3' || value100[0]!='1' || value100[0]=='b' || value100[1]=='c' ) {
      this.setState({
        show:'block'
      })
    }
    if (value100[0]=='3' || value100[0]=='1' || value100[0]=='b' || value100[1]=='c'  ) {
      this.setState({
        show:'none'
      })
    }
    if (value100[0]==null) {
      this.setState({
        show:'none'
      })
    }

  }

  getliverate = ()=>{
    return 
  }



  render(){
    return(
      <div>
        {this.state.from=='ltc'
        ?<div>
        <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1}  changetodoge4={this.changetodoge2} changetoltc4={this.changetoltc2} changetobtc4={this.changetobtc2}  value7={this.getliverate} />
        </div>
        :<div>
          {this.state.from=='doge'
          ?<div>
        <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1}  changetodoge4={this.changetodoge2} changetoltc4={this.changetoltc2} changetobtc4={this.changetobtc2} />
          </div>
          :<div>{this.state.from=='btc'
          ?<div>
                    <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1} />
          </div>
          :<div>{ this.state.from=='ltc1'
          ?<div>
                    <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1} />
          </div>
          :<div>{this.state.to=='doge' && this.state.from==''
          ?<div>
                    <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1}  changetodoge4={this.changetodoge2} changetoltc4={this.changetoltc2} changetobtc4={this.changetobtc2} event1={this.changetodoge2} value500={this.state.show} />
          </div>
          :<div>{ this.state.to=='btc' && this.state.from==''
          ?<div>
                                <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1}  changetodoge4={this.changetodoge2} changetoltc4={this.changetoltc2} changetobtc4={this.changetobtc2} />
          </div>
          :<div>{ this.state.to=='ltc' && this.state.from==''
          ?<div>
                    <Main1 change1={this.changevalue} value2 ={this.state.value2} value3={this.state.value3} value4={this.state.value4} value5={this.state.value5} value6={this.state.value6} reverse={this.reverse1} value10={this.state.value10} value11={this.state.value11} changetodoge={this.changetodoge1} changetoltc={this.changetoltc1} changetobtc={this.changetobtc1}  changetodoge4={this.changetodoge2} changetoltc4={this.changetoltc2} changetobtc4={this.changetobtc2} event1={this.changetoltc2} value500={this.state.show} />
          </div>
          :<div>error</div>
            }</div>
            }</div>
          }</div>
            }

          </div>
          }</div>
          }
        </div>
      }
      </div>
    )
  }
}

export default App;
